@app.cell(hide_code=True)
def _(mo):
    mo.md(
        r"""
    ## Les différents types d'admonition

    le type le plus "basique" est d'`admonition`, qui apparaît en bleu et n'a pas d'icône:

    /// admonition | type "admonition"

    On s'écrit avec en en cadrant le paragraphe avec ces marques:

    ```markdown
    /// admonition | TITRE DE L'ENCART

    contenu en Markdown...

    ///
    ```
    ///

    Une variante avec icône est le type `note`:

    /// note | type "note"

    ```markdown
    /// note | TITRE DE L'ENCART

    contenu en Markdown...

    ///
    ```
    ///

    on a ensuite différentes variantes de couleurs/icônes

    - le type `danger` (ou `caution` ou `error` c'est pareil):

        /// danger | type "danger"

        ```markdown
        /// danger | TITRE DE L'ENCART

        contenu en Markdown...

        ///
        ```
        ///

    - le type `warning` (ou `attention`):

        /// warning | type "warning"

        ```markdown
        /// warning | TITRE DE L'ENCART

        contenu en Markdown...

        ///
        ```
        ///

    - le type `tip`:

        /// tip | type "tip"

        ```markdown
        /// tip | TITRE DE L'ENCART

        contenu en Markdown...

        ///
        ```
        ///

    - le type `hint`:

        /// hint | type "hint"

        ```markdown
        /// hint | TITRE DE L'ENCART

        contenu en Markdown...

        ///
        ```
        ///
    """
    )
    return


