@app.cell(hide_code=True)
def _(mo):
    mo.md(
        r"""
    ### Différents types d'admonitions "rétractables"

    on peut utiliser `type:` pour changer l'apparence des admonitions:

    /// details | details + info
        type: info
    ```markdown
    /// details | TITRE
        type: info
    ...

    ///
    ```
    ///

    /// details | details + danger
        type: danger
    ```markdown
    /// details | TITRE
        type: danger
    ...

    ///
    ```
    ///

    /// details | details + warning
        type: warning
    ```markdown
    /// details | TITRE
        type: warning
    ...

    ///
    ```
    ///

    /// details | details + tip
        type: tip
    ```markdown
    /// details | TITRE
        type: tip
    ...

    ///
    ```
    ///

    _attention: toutes les classes qui fonctionnent sur les "admonition"s ne fonctionnent pas avec les "details" (ça serait trop simple...)_
    """
    )
    return


